// 2197. Replace Non-Coprime Numbers in Array
// https://leetcode.com/problems/replace-non-coprime-numbers-in-array/description

using System.Runtime.CompilerServices;
using System.Runtime.InteropServices;
using System.Security.Cryptography.X509Certificates;
using System.Text;

using Microsoft.VisualBasic;

public class Solution {

    public int GCD(int a, int b) {
        if (b == 0) {
            return a;
        } else {
            return GCD(b, a % b);
        }
    }

    public int LCM(int a, int b, int gcd) {
        long a1 = (long)a;
        long b1 = (long)b;
        long gcd1 = (long)gcd;
        return (int) (a1 / gcd1 * b1);
    }

    public IList<int> Mine(int[] nums) {
        List<int> current = nums.ToList();

        bool hasCoprimes = true;
        while (hasCoprimes) {

            hasCoprimes = false;
            for (int left = 0; left < current.Count - 1; left++) {

                int right = left + 1;
                while (left >= 0 && right <= current.Count - 1) {
                    int a = current[left];
                    int b = current[right];
                    int gcd = GCD(a, b);
                    if (gcd == 1) { break; }
                    
                    int lcm = LCM(a, b, gcd);
                    current.Insert(right + 1, lcm);
                    current.RemoveRange(left, 2);
                    left -= 1;
                    right = left + 1;
                    hasCoprimes = true;
                }
            }
        }

        return current;
    }

    public IList<int> ReplaceNonCoprimes(int[] nums) {
        List<int> stack = new();
        for (int i = 0; i < nums.Length; i++) {
            stack.Add(nums[i]);

            while (stack.Count >= 2) {
                int a = stack[stack.Count - 2];
                int b = stack[stack.Count - 1];
                int gcd = GCD(a, b);
                if (gcd != 1) {
                    int lcm = LCM(a, b, gcd);
                    stack.RemoveRange(stack.Count - 2, 2);
                    stack.Add(lcm);
                    continue;
                }
                break;
            }
        }

        return stack;
    }
}

